 Here's a simple C++ program that reads network packets from a socket on port 888:
```c++
#include <iostream>
#include <netinet/in.h>
#include <sys/socket.h>
#include <arpa/inet.h>
#include <unistd.h>

using namespace std;

int main() {
    int sockfd = socket(AF_INET, SOCK_STREAM, 0);
    struct sockaddr_in serv_addr;

    serv_addr.sin_family = AF_INET;
    serv_addr.sin_addr.s_addr = inet_addr("127.0.0.1");
    serv_addr.sin_port = htons(888);

    connect(sockfd, (struct sockaddr *) &serv_addr, sizeof(serv_addr));

    char buffer[1024] = {0};
    int n = recv(sockfd, buffer, 1024, 0);
    buffer[n] = '\0';

    cout << "Received: " << buffer << endl;
}
```
In this program, a TCP socket is created with the identifier `sockfd`. Then, the address of the server to connect to is specified in the `serv_addr` structure. The `connect` function is used to connect to the server. Then, a `recv` function is used to read network packets from the socket. The contents of the network packets are stored in the `buffer` array, and the contents of `buffer` are printed to the console.

