// Draw rows
let row = 0;
let sum = 1;
while (row < size) {
  const rowText = document.getElementById(`row-${row}`);
  rowText.innerHTML = `${sum} `;
  row++

  // Calculate row elements
  const elements = [];
  for (let col = 0; col < size; col++) {
    const xPos = col * (size + 1);
    const yPos = row * (size + 1);
    const element = document.getElementById(`element-${row}-${col}`);
    element.style.left = `${xPos}px`;
    element.style.top = `${yPos}px`;
    elements.push(`${sum} `);
    sum += col + row;
  }

  // Draw elements
  for (let i = 0; i < elements.length; i++) {
    rowText.appendChild(elements[i]);
  }
}
